import axios from 'axios';
import { useState } from 'react'
import { useParams } from 'react-router';
import { useEffect } from 'react';
import s from '../styles/dog.module.css'

export default function DogDetail(){
    const [dog,setDog] = useState(null);
    let {id} = useParams()

    useEffect(() => {
       async function fetchData(){
            try {
                await axios.get('http://localhost:3001/api/dogs/'+{id})
                .then((response) => {
                    console.log(response)
                    setDog(response.data.value)
                })
            }
            catch(error){
                console.log(error)
            }
        };
        fetchData()
    })

    return <div>
        <h1>{dog.name} {dog.weight} {dog.height} {dog.lifespan} </h1>
        <img className={s.image} src={dog.image} alt='imagen'/> 
    </div>
}
